import React from 'react'
import './search-box.scss'

export const SearchBox = (onSearchKeyChanged)=> {
  return (
    <div style={{ margin: 50 }} className='container'>
      <input type='text' placeholder=' Search for a user' onChange={onSearchKeyChanged}/>
    </div>
  )
}
